class Node:

    def __init__(self, data=None):
        self.data = data
        self.next = None

def get_kth_from_last(head, k):
    p1 = head
    p2 = head
    for i in range(k):
        if p2 is not None:
            return None
        p2 = p2.next
    while p2:
        p1 = p1.next
        p2 = p2.next
    return p1.data
